// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SongSelection from './SongSelection'; // Main component for the default route
import Login from './Login'; // Component you want to access
import { GameProvider } from './context/GameContext';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SongSelection />} /> {/* Default route */}
        <Route path="/login" element={<Login />} /> {/* Route for Log component */}
      </Routes>
    </Router>
  );
}

export default App;
